import{ Actores} from '../actores'
import{ Actor} from '../mock-actores'
@Component({
  selector: 'app-reparto',
  templateUrl: './reparto.component.html',
  styleUrls: ['./reparto.component.css']
})
export class RepartoComponent {
  actores: Actores[]= [];

  mostrarMensaje(){
    this.actores = Actor
    return this.actores
  }
}
